import Link from "next/link";

export default () => (
    <header>
        <nav>
            <div>
                <ul>
                    <li>
                        <Link href={"/"}>
                            <a>Home</a>
                        </Link>
                    </li>
                    <li>
                        <Link href={"/about"}>
                            <a>About</a>
                        </Link>
                    </li>
                </ul>
            </div>
        </nav>

        <style jsx>{
            `
                header {
                    background-color: red;
                }
            `
        }</style>

    </header>
);
